import React, { Component } from 'react';

import "./add-two-numbers.css"

class AddTwoNumbers extends Component{
    sum() 
    {
        var data1 = parseInt(document.getElementById("num1").value);
        var data2 = parseInt(document.getElementById("num2").value);
        var total = data1 + data2; 
        
        document.getElementById("total").innerHTML=total;
    }
        
render()
    {
        return (
                <div>
                    <h2>Addition</h2>
                        <div className="input-field">
                            <label>Number 1:</label>
                            <input type="text" id="num1"/>
                        </div>

                        <div>
                            <label>Number 2:</label>
                            <input type="text" id="num2"/>
                        </div>

                        <div>
                        <input type="submit" onClick={() => this.sum()}></input>
                        </div>
                        
                        <div>
                            <label>Total</label>
                            <div id="total"></div>
                        </div>
                </div>
                )
    }    
}

export default AddTwoNumbers;
